import React from 'react'
const WeatherItem = props => {
    const{
        city,
        country,
        image,
        weather,
        date,
        time,
        temp,
        tempMax,
        tempMin,
        pressure,
        wind,
        error} = props.weather

        let content = null

        if(!error && city){
            content = (
                <div>
                <img src={image} width="100" height="100" />
                {city},{country}
                <td>{date}</td>
                {time}
                <td>{weather}</td>
                Aktualna temperatura: {temp}&deg;
                <td>Temperatura maksymalna:{tempMax}&deg;</td>  
                Temperatura minimalna:{tempMin}&deg;
                <td>Ciśnienie:{pressure} hPa</td>  
                Wiatr:{wind}km/h
                </div>
            )
        }
    return (<div className="weatherCard">
        {error ? `Brak danych dla podanego maista - ${city} nie istnieje lub zostało błędnie wpisane!` : content}

    </div>
    )}

export default WeatherItem
